import web3 from './web3';
import PollManager from './build/PollManager.json';

const instance = new web3.eth.Contract(
    JSON.parse(PollManager.interface),
    '0x98Ac74bF0b497af3BD3582f6c8e630b2B43ee57d'
);

export default instance;
